// 获取邮箱
function getEmail(prefix) {
  var subfix = ['@gmail.com', '@yahoo.com', '@msn.com', '@hotmail.com', '@aol.com', '@ask.com', '@live.com', '@qq.com', '@0355.net', '@163.com', '@163.net', '@263.net', '@3721.net', '@yeah.com'];
  var prefix = prefix || '';
  prefix = Mtils.utils.makePy(prefix);

  var j = Mtils.security.randomBetween(1, 14);
  var k = Mtils.security.randomBetween(5, 20);
  if (prefix) {
    k = Mtils.security.randomBetween(1, 5);
    prefix += "_";
  }
  result = [];
  for (var i = 0; i < k; i++) {
    var ranNum = Math.ceil(Math.random() * 25);
    result.push(String.fromCharCode(65 + ranNum));
  }

  var res = prefix + result.join("");
  if (subfix[j]) {
    res += subfix[j];
  } else {
    res = '';
  }
  return res.toLocaleLowerCase();
};

